    false,nt"url": null,nt"notes": "This annual narrative report for Rice Lake
    and Mille Lacs National Wildlife Refuges outlines Refuge accomplishments during
    the 1997 fiscal year. The report begins with an introduction to the Refuge. Highlights
    and weather conditions are summarized for the year. Information about monitoring
    and studies- including surveys and censuses and studies and investigations- is provided
    next. Habitat restoration and management projects are also covered; activities include
    upland restoration, water level management, mowing, farming, timber management,
    prescribed burning, and vegetation control. Fish and wildlife management are discussed
    next with emphasis on reintroductions, nest structures, and animal control. Coordination
    activities, such as interagency coordination, tribal coordination, and private land
    activities, are outlined. The resource protection section provides an update on
    law enforcement, wildfire preparedness, and permits. Information about public education
    and recreation is given including visitor services and outreach. Finally, general
    administration is discussed in the Refuge planning and administration section. Refuge
    brochures and field guides are attached.",nt"license_title": "License Not
